import "./Featured.scss";
function Featured() {
  return (
    <div className='featured'>
        <img 
          src="https://upload.wikimedia.org/wikipedia/commons/6/68/Orange_tabby_cat_sitting_on_fallen_leaves-Hisashi-01A.jpg" 
          alt="" />
    </div>
  )
}

export default Featured
